import styled from 'styled-components'

export const PropertyTypeLabelWrapper = styled.div`
   color: #fff;
   background-color: #126efd;
   border-radius: 6px;
   padding: 5px 3px;
   
   p {
   color: #fff;
   margin: 0;
   font-size: 0.88em;
   }
`;
